/*

PN expressions for the spheroidal harmonics: Slm_aw[l, m]

 --R. Fujita 
    PTEP 2015 (2015) no.3, 033E01: 1412.5689

 30th Oct. 2018; R. Fujita (original)
 8th Nov. 2020; Sis 


 Current PN orders :
 4.5PN = O(w^3; 2 <= ell <= 10)  and 6PN = O(w^4;  2 <= ell <= 12);
w    := O(v^3) = 1.5PN


//Shorthanded variables for PN Spheroidal harmonics:
// They need to be precomputed as input. 

xtmp = X = cos(Theta);

1. - X = Xm, 1. + X = Xp, Xfactor =sqrt(Xm * Xp)

Sq[n]... = 1, q, q^2, q^3, q^4
Sw[n]... = 1, w, w^2, w^3, w^4

SXp[n]... = 1, Xp, Xp ^ 2, ..., Xp ^ 8, Xp ^ 9
SX[n]... = 1, X, X ^ 2, ..., X ^ 15, X^ 16


*/


