CUDA_CALLABLE_MEMBER
void init_PNSlm(const double q, const double Theta, Slm_aw_PNvar* PN_Slm, const int flag) {

    int i;
    double Xtmp;


    /*Xfactor, PNq[], PNw[], Xp[], X[]*/
    if (flag == 1) { // for RIGHT mode sum (n > 0) in `mode_sum_GW.c`*/

        Xtmp = cos(Theta);

    }
    else if (flag == 0) { // for LEFT mode sum (n < 0) in `mode_sum_GW.c` uing symmetry*/

        Xtmp = (-1.0) * cos(Theta);  // cos( Pi - Theta )

    }
    else {

        perror("Parameter errors: initialize_PNSlm in `omp_amp_data.c`");
        exit(1);

    }

    /* Auxiliary variables */
    double Xptmp = 1.0 + Xtmp;
    double Xmtmp = 1.0 - Xtmp;


    /* Precomute Xfactor, PNq[], Xp[], Xm[], X[] OUTSIDE the for loop of time evolution */
    /* these variables stay CONSTANTS along the evolutions */
    PN_Slm->Xfactor = sqrt(Xptmp * Xmtmp);


    /* PNq[n]... = 1, q, q ^2, q^4*/
    PN_Slm->Sq[0] = 1.0;
    for (i = 1; i < Sq_max; i++) {

        PN_Slm->Sq[i] = q * PN_Slm->Sq[i - 1];

    }

    /* Xp[n]... = 1, Xp, Xp ^ 2, ..., Xp ^ 5 */
    PN_Slm->Xp[0] = 1.0;
    for (i = 1; i < Xp_max; i++) {

        PN_Slm->Xp[i] = Xptmp * PN_Slm->Xp[i - 1];

    }

    /* X[n]... = 1, X, X ^ 2, ..., X ^ 15, X^ 16*/
    PN_Slm->X[0] = 1.0;
    for (i = 1; i < X_max; i++) {

        PN_Slm->X[i] = Xtmp * PN_Slm->X[i - 1];

    }


}
CUDA_CALLABLE_MEMBER
double Slm_aw(const int l, const int m, Slm_aw_PNvar* PN_Slm) { //

    // NULL check
    if (PN_Slm == NULL) {

        perror("Pointer errors: Slm_aw");
        exit(1);

    }

    switch (l) {
    case 2:
        return S2m_aw(m, PN_Slm);
        break;
    case 3:
        return S3m_aw(m, PN_Slm);
        break;
    case 4:
        return S4m_aw(m, PN_Slm);
        break;
    case 5:
        return S5m_aw(m, PN_Slm);
        break;
    case 6:
        return S6m_aw(m, PN_Slm);
        break;
    case 7:
        return S7m_aw(m, PN_Slm);
        break;
    case 8:
        return S8m_aw(m, PN_Slm);
        break;
    case 9:
        return S9m_aw(m, PN_Slm);
        break;
    case 10:
        return S10m_aw(m, PN_Slm);
        break;
    case 11:
        return S11m_aw(m, PN_Slm);
        break;
    case 12:
        return S12m_aw(m, PN_Slm);
        break;
    default:
        perror("Paramerer errors: Slm_aw");
        exit(1);
        break;
    }
   
    return 0;

}